(function () {
  class CasarcProvider {
    constructor() {
      this.isCasarc = true;
      this.isMetaMask = true;
      this.selectedAddress = null;
      this.chainId = null;
      this._events = {};
    }

    on(event, listener) {
      if (!this._events[event]) this._events[event] = [];
      this._events[event].push(listener);
      return this;
    }

    removeListener(event, listener) {
      const arr = this._events[event];
      if (!arr) return this;
      this._events[event] = arr.filter((fn) => fn !== listener);
      return this;
    }

    removeAllListeners(event) {
      if (event) {
        delete this._events[event];
      } else {
        this._events = {};
      }
      return this;
    }

    _emit(event, ...args) {
      const arr = this._events[event];
      if (!arr) return;
      for (const fn of arr) {
        try {
          fn(...args);
        } catch (e) {
          console.error("casarc event listener error", e);
        }
      }
    }

    isConnected() {
      return !!this.selectedAddress;
    }

    request(args) {
      if (!args || typeof args.method !== "string") {
        return Promise.reject(new Error("Invalid request arguments"));
      }

      const method = args.method;
      const params = Array.isArray(args.params) ? args.params : [];
      const id = Math.random().toString(36).slice(2);

      return new Promise((resolve, reject) => {
        const handler = (event) => {
          const msg = event.data;
          if (!msg || msg.source !== "casarc-extension") return;
          if (msg.id !== id) return;

          window.removeEventListener("message", handler);
          const res = msg.response;

          if (!res || !res.ok) {
            const message = (res && res.error) || "Request failed";
            const err = new Error(message);

            if (/User rejected/i.test(message)) {
              err.code = 4001;
            }

            reject(err);
            return;
          }

          if (method === "eth_chainId" && res.result) {
            const newChainId = res.result;
            if (this.chainId !== newChainId) {
              this.chainId = newChainId;
              this._emit("chainChanged", this.chainId);
            }
          }

          if (
            (method === "eth_accounts" || method === "eth_requestAccounts") &&
            Array.isArray(res.result)
          ) {
            const prev = this.selectedAddress;
            this.selectedAddress = res.result[0] || null;

            if (!prev && this.selectedAddress) {
              this._emit("connect", { chainId: this.chainId || null });
            }

            if (prev !== this.selectedAddress) {
              this._emit("accountsChanged", res.result);

              if (!this.selectedAddress) {
                this._emit("disconnect", {
                  code: 4900,
                  message: "User disconnected"
                });
              }
            }
          }

          resolve(res.result);
        };

        window.addEventListener("message", handler);

        window.postMessage(
          {
            source: "casarc-inpage",
            id,
            method,
            params
          },
          "*"
        );
      });
    }

    sendAsync(payload, cb) {
      this.request({ method: payload.method, params: payload.params || [] })
        .then((result) => {
          const response = {
            id: payload.id,
            jsonrpc: payload.jsonrpc || "2.0",
            result
          };
          cb(null, response);
        })
        .catch((err) => {
          cb(err, null);
        });
    }

    send(payload, cb) {
      if (typeof cb === "function") {
        return this.sendAsync(payload, cb);
      }
      return this.request({
        method: payload.method,
        params: payload.params || []
      });
    }
  }

  const casarcProvider = new CasarcProvider();

const CASARC_ICON_DATA_URL = "data:image/png;base64,";

  const CASARC_EIP6963_INFO = {
    uuid: "8f0e4a70-9fa9-4ec2-9b0a-7f4c5f0c7c01",
    name: "Casarc Wallet",
    icon: CASARC_ICON_DATA_URL,
    rdns: "wallet.casarc"
  };

  function installIntoWindow() {
    const w = window;

    if (!w.casarc) {
      Object.defineProperty(w, "casarc", {
        value: casarcProvider,
        configurable: false,
        enumerable: false,
        writable: false
      });
    }

    const existingEthereum = w.ethereum;

    if (!existingEthereum) {
      const providers = [casarcProvider];
      casarcProvider.providers = providers;

      Object.defineProperty(w, "ethereum", {
        configurable: true,
        enumerable: false,
        get() {
          return casarcProvider;
        }
      });

      w.ethereum.providers = providers;
    } else {
      let providers = existingEthereum.providers;

      if (Array.isArray(providers)) {
        providers = providers.slice();
      } else {
        providers = [existingEthereum];
      }

      if (!providers.includes(casarcProvider)) {
        providers.push(casarcProvider);
      }

      existingEthereum.providers = providers;
      w.ethereum.providers = providers;
    }

    function announceEip6963() {
      try {
        const ev = new CustomEvent("eip6963:announceProvider", {
          detail: {
            info: CASARC_EIP6963_INFO,
            provider: casarcProvider
          }
        });
        w.dispatchEvent(ev);
      } catch (e) {
        console.error("Casarc eip6963 announce error", e);
      }
    }

    w.addEventListener("eip6963:requestProvider", () => {
      announceEip6963();
    });

    announceEip6963();
  }

  installIntoWindow();
})();
